import React from 'react';
import Person from './Result/Result';

const results = (props) => (
    props.results.map((result, index) => {
        return <Result
            key={result.id}
            click={() => props.clicked(index)}
            name={result.name}
            age={result.description}
            changed={(event) => props.changed(event, result.id)} />
    })
);

export default results;
